import React from "react";

class SearchBox extends React.Component {
  render() {
    return (
      <div className="ui category search">
        <div className="ui icon input">
          <input
            className="prompt"
            type="text"
            placeholder="Search your tube ..."
          />
          <i className="search icon"></i>
        </div>
      </div>
    );
  }
}

export default SearchBox;
